import { useEffect, useState } from 'react';
import axios from 'axios';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';
import Modal from '@mui/material/Modal';
import Box from '@mui/material/Box';
import Grid from '@mui/material/Grid';
import TextField from '@mui/material/TextField';
import Button from '@mui/material/Button';
import { createTheme, ThemeProvider } from '@mui/material/styles';

// TODO remove, this demo shouldn't need to reset the theme.
const defaultTheme = createTheme();

interface Application {
  applicationID: number;
  netID: string;
  scholarshipID: number;
  firstName: string;
  lastName: string;
  essay: string;
  transcript: string;
  recommendationLetter: string;
  status: string;
}

export default function MuiTable({ endpoint }: { endpoint: string }) {
  const [tableData, setTableData] = useState<Application[]>([]);
  const [selectedApplication, setSelectedApplication] = useState<Application | null>(null);

  useEffect(() => {
    axios.get(endpoint)
      .then(response => {
        const { applications } = response.data;
        setTableData(applications);
      })
      .catch(error => {
        console.error('Error fetching data:', error);
      });
  }, []);

  const handleRowClick = (application: Application) => {
    setSelectedApplication(application);
  };

  const closeModal = () => {
    setSelectedApplication(null);
  };

  return (
    <>
      <TableContainer component={Paper} style={{ backgroundColor: "#FAFAFA" }}>
        <Table aria-label="simple table">
          <TableHead>
            <TableRow>
              <TableCell align="center" style={{ verticalAlign: "top" }}>Application ID</TableCell>
              <TableCell align="center" style={{ verticalAlign: "top" }}>Net ID</TableCell>
              <TableCell align="center" style={{ verticalAlign: "top" }}>Scholarship ID</TableCell>
              <TableCell align="center" style={{ verticalAlign: "top" }}>First Name</TableCell>
              <TableCell align="center" style={{ verticalAlign: "top" }}>Last Name</TableCell>
              <TableCell align="center" style={{ verticalAlign: "top" }}>Status</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {tableData.map((row) => (
              <TableRow key={row.applicationID} onClick={() => handleRowClick(row)} style={{ cursor: "pointer" }}>
                <TableCell align="center">{row.applicationID}</TableCell>
                <TableCell align="center">{row.netID}</TableCell>
                <TableCell align="center">{row.scholarshipID}</TableCell>
                <TableCell align="center">{row.firstName}</TableCell>
                <TableCell align="center">{row.lastName}</TableCell>
                <TableCell align="center">{row.status}</TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>

      {selectedApplication && (
        <ThemeProvider theme={defaultTheme}>
          <Modal open={true} onClose={closeModal} style={{ display: 'flex', alignItems: 'center', justifyContent: 'center' }}>
            <div style={{ width: '80vw', height: '90vh', backgroundColor: 'white', position: 'relative' }}>
              <button onClick={closeModal} style={{ position: 'absolute', top: '5px', left: '5px' }}>×</button>
              <h1 style={{marginLeft: '20px'}}>Application Details for {selectedApplication.firstName} {selectedApplication.lastName}</h1>
              <Box sx={{ mt: 3, ml: 5, mr: 5 }}>
                <Grid container spacing={2}>
                  <Grid item xs={12}>
                    <TextField
                      label="Application ID"
                      value={selectedApplication.applicationID}
                      fullWidth
                      disabled
                    />
                  </Grid>
                  <Grid item xs={12}>
                    <TextField
                      label="Net ID"
                      value={selectedApplication.netID}
                      fullWidth
                      disabled
                    />
                  </Grid>
                  <Grid item xs={12}>
                    <TextField
                      label="Scholarship ID"
                      value={selectedApplication.scholarshipID}
                      fullWidth
                      disabled
                    />
                  </Grid>
                  <Grid item xs={12}>
                    <TextField
                      label="First Name"
                      value={selectedApplication.firstName}
                      fullWidth
                      disabled
                    />
                  </Grid>
                  <Grid item xs={12}>
                    <TextField
                      label="Last Name"
                      value={selectedApplication.lastName}
                      fullWidth
                      disabled
                    />
                  </Grid>
                  <Grid item xs={12}>
                    <TextField
                      label="Essay"
                      value={selectedApplication.essay}
                      fullWidth
                      multiline
                      disabled
                    />
                  </Grid>
                  <Grid item xs={12}>
                    <TextField
                      label="Transcript"
                      value={selectedApplication.transcript}
                      fullWidth
                      multiline
                      disabled
                    />
                  </Grid>
                  <Grid item xs={12}>
                    <TextField
                      label="Recommendation Letter"
                      value={selectedApplication.recommendationLetter}
                      fullWidth
                      multiline
                      disabled
                    />
                  </Grid>
                  <Grid item xs={12}>
                    <TextField
                      label="Status"
                      value={selectedApplication.status}
                      fullWidth
                      disabled
                    />
                  </Grid>
                </Grid>
              </Box>
            </div>
          </Modal>
        </ThemeProvider>
      )}
    </>
  );
}
